import practiceByGuestConsts from '../actions/PracticeByGuestAction'

const initialState = {
  item: {
    hotel_id: null,
    rate_plan_id: null,
    customer: {
      first_name: "",
      last_name: "",
      email: "",
      mobile: "",
    },
    message: "",
    privacy: 0,
    checkin: null,
    checkout: null,
    treatment: null,
    numRooms: 1,
    rooms: [
      {
        adults: 2,
        childrens: 0,
        childrenAges: []
      }
    ],
    transfer_id: null
  }
}

const InitReducer = (state = intitialState, action) => {
  switch (action.type) {
    case 'RESET_ITEM':
      return initialState
    case 'SET_ITEM':
      return {
        item: action.item
      }
    case 'CREATE':
      return {
        item: action.item
      }
    default:
      return state;
  }
}

export default InitReducer;
